import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // CSSファイルのインポート

export const Header = () => {
    return(
        <div className='header-wrapper'>
            <Link to='/'>Top</Link>
            <Link to='/theme'>Theme</Link>
        </div>
    )
}
